import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      list: ["a", "b", "c"],
    };
  }

  render() {
    return <div>{this.state.list.map((item) => item)}</div>;
  }
}

export default App;
